DROP TABLE IF EXISTS "address" CASCADE;
CREATE TABLE IF NOT EXISTS "address" ("city" VARCHAR(255), "id" INTEGER , "street" VARCHAR(255), "postcode" INTEGER, "house_number" VARCHAR(255), PRIMARY KEY ("id"));
DROP TABLE IF EXISTS "insurance_company" CASCADE;
CREATE TABLE IF NOT EXISTS "insurance_company" ("id" INTEGER , "address_id" INTEGER REFERENCES "address" ("id"), "name" VARCHAR(255), PRIMARY KEY ("id"));
DROP TABLE IF EXISTS "patients" CASCADE;
CREATE TABLE IF NOT EXISTS "patients" ("address_id" INTEGER REFERENCES "address" ("id"), "age" INTEGER, "first_name" VARCHAR(255), "insurance_number" INTEGER, "last_name" VARCHAR(255), "id" INTEGER , "insurance_id" INTEGER REFERENCES "insurance_company" ("id"), PRIMARY KEY ("id"));
